import React from 'react'

const Home = ({ TrendingJSON }) => {
    var TrendingCoin = []
    TrendingJSON.forEach((coin) => {
        TrendingCoin.push(coin)
    })
    console.log(TrendingCoin)
    return (
        <div>
            <div>Trending right now</div>
        </div>
    )
}

export default Home
